    def test_gather_categories(self):
        """
        Testing gather_category function from iTol.py. If successful, the
        function will be moved to util.py.

        :return: Returns OK if test goals were achieved, otherwise raises
                error.
        """
        # Obtaining arguments for gather_categories()
        with tempfile.TemporaryFile() as temp_file12:
            temp_file12.write(self.implantdata)
            temp_file12.seek(0)
            map_header = temp_file12.readline()[1:].strip().split('\t')
            map_data = qtu.parse_map_file(temp_file12)

        result = qtu.gather_categories(map_data, map_header)
        result1 = qtu.gather_categories(
            map_data, map_header, ['SmokingStatus', 'DiseaseState']
            )
        sum = fsum([
            len(result1.values()[0][0]), len(result1.values()[1][0]),
            len(result1.values()[2][0]), len(result1.values()[3][0]),
            len(result1.values()[4][0]), len(result1.values()[5][0])
            ])

        # Testing if the function calculates without any categories.
        manual1 = 162
        self.assertEqual(
            len(result.values()[0][0]), manual1,
            msg='Function did not output all of the SampleID\'s.'
        )

        # Testing if the function accurately calculates different categories
        # given various conditions
        # Here, I chose ['SmokingStatus', 'DiseaseState'].
        manual2 = 6
        self.assertEqual(
            len(result1.keys()), manual2,
            msg='Function did not calculate the combination of categories accurately.'
        )
        manual3 = 162
        self.assertEqual(
            sum, manual3,
            msg='Function did not output all of the SampleID\'s.'
        )

